import React from 'react'
import styled from 'styled-components'
import DetailFeedScreenRelatedVideo from './DetailFeedScreenRelatedVideo'

const DetailsFeedScreenRelated = ({videos}) => {
  
  return (
    <Main>
      <h3>Up Next</h3>
      {
        videos.map((video) => (
          <DetailFeedScreenRelatedVideo key={video.id.videoId} video={video} onClick={hand}/>
        ))
      }
    </Main>
  )
}

export default DetailsFeedScreenRelated

const Main = styled.div`
width: 20%;
min-height: 100vh;
background-color: #282828;
color: white;
padding-top: 10px;
z-index: -1;
`
